import { Navbar, Container } from "react-bootstrap";

const Header = () => {
  return (
    <>
      <Navbar className="bg-body-black">
        <Container>
          <Navbar.Brand href="#home">
            <img
              alt=""
              src="/img/logo.svg"
              width="30"
              height="30"
              className="d-inline-block align-top"
            />{" "}
            React Bootstrap
          </Navbar.Brand>
        </Container>
      </Navbar>
    </>
  );
};
export default Header;
